import React from 'react';
import { Handle, Position } from '@xyflow/react';
import { Phone, PhoneCall } from 'lucide-react';

const DidNode = ({ data }) => {
  const { metadata } = data;
  const phoneNumber = metadata?.phone_number;
  const isActive = metadata?.is_active;
  const destination = metadata?.destination_identifier;

  return (
    <div className={`px-4 py-2 min-w-[200px] max-w-[250px] ${isActive ? 'bg-blue-50' : 'bg-gray-50'} border-2 ${isActive ? 'border-blue-500' : 'border-gray-400'} rounded-lg shadow-md`}>
      <Handle type="target" position={Position.Left} className="w-3 h-3" />

      <div className="flex items-center gap-2 mb-2">
        <Phone className="w-4 h-4 text-blue-600" />
        <span className="font-semibold text-sm">DID</span>
        {isActive && <span className="text-xs bg-green-100 text-green-800 px-2 py-1 rounded">Active</span>}
      </div>

      <div className="space-y-1 text-xs">
        <div className="font-mono text-sm font-semibold text-blue-800">
          {phoneNumber || 'No Number'}
        </div>

        {destination && (
          <div className="flex items-center gap-1 text-gray-600">
            <PhoneCall className="w-3 h-3" />
            <span>â†’ {destination}</span>
          </div>
        )}

        {metadata?.dial_rule_application && (
          <div className="text-gray-500">
            Rule: {metadata.dial_rule_application}
          </div>
        )}
      </div>

      <Handle type="source" position={Position.Right} className="w-3 h-3" />
    </div>
  );
};

export default DidNode;
